"original": |2-
     Feed publishers may indicate that some IP prefixes should not have
     any associated geolocation information.  It may be that some prefixes
     under their administrative control are reserved, not yet allocated or
     deployed, or in the process of being redeployed elsewhere and
     existing geolocation information can, from the perspective of the
     publisher, safely be discarded.
"fixed": |-
  Feed publishers may indicate that some IP prefixes should not have any associated geolocation information.  It may be that some prefixes under their administrative control are reserved, not yet allocated or deployed, or in the process of being redeployed elsewhere and existing geolocation information can, from the perspective of the publisher, safely be discarded.
"ko": |-
  피드 퍼블리셔는 일부 IP 접두사에 연관된 지리적 위치 정보가 없어야 한다고 표시할 수 있습니다. 관리 제어 하에 있는 일부 접두사가 예약되어 있거나 아직 할당 또는 배포되지 않았거나 다른 곳에 다시 배포되고 있는 중일 수 있으며, 퍼블리셔의 관점에서 기존 지리적 위치 정보는 안전하게 삭제될 수 있습니다.
